Bill Hicks in 1992, filmed @ his favorite venue, The Comedy Workshop in Houston, Texas. Shortly beforehand, on a trip to Australia, he found out he had cancer. I believe this to be one of his last shows.

On Saturday, February 26th, 1994, Bill died. He was 32.


